import React from 'react';
import PropTypes from 'prop-types';
import cn from 'classnames';
import classes from './Hero.module.scss';

const Hero = ({
  heroPreText,
  heroHeadline,
  heroPostText,
  image,
}) => {
  return (
    <div className="hero-container">
      <div className="media-container">
        <img src="https://picsum.photos/id/1045/1000/500"/>
      </div>
      <div className="text-container">
        <div className="bar" />
        <p className={cn('pre-text', 'text-small')}>{ heroPreText }</p>
        <h1 className={cn('hero-headline', 'headline')}>{ heroHeadline }</h1>
        <p className="post-text">{ heroPostText }</p>
      </div>
    </div>
  );
}

Hero.propTypes = {
  heroPreText: PropTypes.string,
  heroHeadline: PropTypes.string,
  heroPostText: PropTypes.string,
  image: PropTypes.string,
};

Hero.defaultProps = {
  heroPreText: '',
  heroHeadline: '',
  heroPostText: '',
  image: '',
};

export default Hero;
